`,paraId:45,tocIndex:19},{value:"ES6 \u4E3A\u4E86\u7EDF\u4E00\u96C6\u5408\u7C7B\u578B\u6570\u636E\u7ED3\u6784\u7684\u5904\u7406\uFF0C\u589E\u52A0\u4E86 iterator \u63A5\u53E3\uFF0C\u4F9B for...of \u4F7F\u7528\uFF0C\u7B80\u5316\u4E86\u4E0D\u540C\u7ED3\u6784\u6570\u636E\u7684\u5904\u7406\u3002\u800C iterator \u7684\u904D\u5386\u8FC7\u7A0B\uFF0C\u5219\u662F\u7C7B\u4F3C Generator \u7684\u65B9\u5F0F\uFF0C\u8FED\u4EE3\u65F6\u4E0D\u65AD\u8C03\u7528 next \u65B9\u6CD5\uFF0C\u8FD4\u56DE\u4E00\u4E2A\u5305\u542B value\uFF08\u503C\uFF09\u548C done \u5C5E\u6027\uFF08\u6807\u8BC6\u662F\u5426\u904D\u5386\u7ED3\u675F\uFF09\u7684\u5BF9\u8C61\u3002",paraId:46,tocIndex:20},{value:`// \u666E\u901A\u5BF9\u8C61
const obj = {
  foo: 'value1',
  bar: 'value2',
  [Symbol.iterator]() {
    // \u8FD9\u91CCObject.keys\u4E0D\u4F1A\u83B7\u53D6\u5230Symbol.iterator\u5C5E\u6027\uFF0C\u539F\u56E0\u89C1\u4E0B\u6587
    const keys = Object.keys(obj); 
    let index = 0;
    return {
      next: () => {
        if (index < keys.length) {
          // \u8FED\u4EE3\u7ED3\u679C \u672A\u7ED3\u675F
          return {
            value: this[keys[index++]],
            done: false
          };
        } else {
          // \u8FED\u4EE3\u7ED3\u679C \u7ED3\u675F
          return { value: undefined, done: true };
        }
      }
    };
  }
}
for (const value of obj) {
  console.log(value); // value1 value2
};
