const Test: FC = () => {
  const [url, setUrl] = useState('xxx?a=1&b=4&s=5');
  const [res, setRes] = useState({});

  const parse = (parseUrl) => {
    const res = urlParse(parseUrl);
    setRes(res);
  };

  useEffect(() => {
    parse(url);
  }, []);

  return (
    <div>
      <Search
        addonBefore="https://"
        placeholder="input url"
        value={url}
        allowClear
        onChange={(e) => {
          const val = e.target.value;
          setUrl(val);
        }}
        onSearch={(parseUrl) => {
          parse(parseUrl);
        }}
      />
      <pre>{JSON.stringify(res)}</pre>
    </div>
  );
};

